import React from 'react';
import { Card } from "antd";
import "antd/dist/antd.css";
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Choose your favorite animal!
      <div >
        <Card title="Default size card" style={{ margin: 30, width: 300}}>
          <p>Card content!</p>
        </Card>
      </div>

      </header>

    </div>
  );
}

export default App;
